import React from 'react';
import './css/widget.css';

function Widget() {
    return(
        <div className="widget">
            <div className="widget_top">
                <div className="widget_header">
                    <h3>Linked </h3>
                </div>
            </div>
            <div className="widget_bottom">
                <div className="widget_top">
                
                </div>
            </div>
        </div>
    )
}

export default Widget
